import React from 'react';
import styled from "styled-components";

const LayoutFooter = styled.footer`
    width:100%; 
    background:#333; 
    color:#e3e3e3;
    *{color: #e5e5e5;}
    .inner{
      padding:30px 15px;
      width: 100%;
      margin: 0 auto;
    }

    .footer_logo{
      font-size:30px;
      margin-bottom:20px;
    }
    .footer_info{
      p{font-size:12px;}
    }

    @media (min-width: 992px) { 
      .inner{
          width:992px;
          padding:0;
      }
    }
    @media (min-width: 1200px) { 
      .inner{
          width:1200px;
      }
    }
`;

const BasicFooter = () => {
  return (<LayoutFooter>
  <div className="inner">

    <div className="footer_logo">
        UNKOWN24
    </div>
      <div className="footer_info"> 
        <p>상호명:주식회사 Unkown24</p>
        <p>대표:문학주</p>
        <p>주소:서울시 ㅇㅇ구 ㅇㅇ동 123-456 </p>
        <p>이메일:mhj6407@gmail.com </p> 
        <p>Copyright © 2017-2019 PuzzleSystems Inc. All rights Reserved.</p>
      </div>


  </div>
</LayoutFooter>)
}

export default BasicFooter;
